.container {
  outline: none;
  display: inline-block;
  white-space: nowrap;
  background-color: #fff;
  position: relative;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
}
.container:hover {
  background-color: #fff !important;
}
.container > *:not(ul) {
  height: 100%;
  display: flex;
  align-items: center;
}
.border {
  border-style: solid;
  border-width: 1px;
}
/* 标题文本 */
.label {
  float: left;
  padding: 0 6px;
  border-right-style: solid;
  border-right-width: 0px;
  white-space: nowrap;
}

/* select容器 */
.selector {
  padding-left: 8px;
  cursor: pointer;
  overflow: hidden;
  text-overflow: ellipsis;
}
.placeholder {
  color: #B0B0B0;
}
.icon {
  float: right;
  width: 22px;
  padding-left: 2px;
  line-height: 0;
  font-size: 16px;
  cursor: pointer;
}
/* 下拉容器 */
.dropdown {
  position: fixed;
  padding: 0;
  margin: 0;
  list-style: none;
  background-color: #fff;
  margin-block-start: 0;
  border-width: 1px;
  border-style: solid;
  overflow-y: auto;
  box-shadow: 0px 0px 5px 0px RGBA(0, 0, 0, 0.1);
}
.option_item {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  height: 30px;
  line-height: 30px;
  padding: 0 8px;
  cursor: pointer;
}

/* 单位 */
.unit {
  float: right;
  padding-right: 8px;
  white-space: nowrap;
}
/* 必填 */
.required {
  float: right;
  padding: 0 2px;
  color: #f00;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
}
/* 禁止操作 */
.disabled {
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  background-color: rgba(255, 255, 255, 0.6);
  opacity: 0.6;
  filter: alpha(opacity=60); 
  cursor: not-allowed;
}
